{
	"@context": "https://schema.org",
	"@type": "FAQPage",
	"mainEntity": [{
		"@type": "Question",
		"name": "Love Me Doはどんな人？",
		"acceptedAnswer": {
			"@type": "Answer",
			"text": "Love Me Do（ラブミードゥ）は吉本興業所属の占い師。「ラブちゃん」の愛称で活動。占星術師、風水師でもある。東洋、西洋の占術に精通し、『ヒルナンデス!』『ラヴィット！』『王様のブランチ』をはじめとするテレビ・ラジオ出演多数。 20代半ばから手相を独学で学び、その後占術ごとの師匠の元で学び、姓名判断、タロット、四柱推命、風水、九星術、易学、人相占い、手相、数秘術などあらゆる占いを習得する。芸能人や芸人のブレイクや予言、政界の重大ニュース、プロサッカーの試合結果や得点選手、自然災害の予言など、数々の予言的中エピソードを持つ業界最注目の占い師として絶大な人気を誇る。 全国で行われる占いライブは「会うと運がよくなる」「歩くパワースポット」などと言われ、予約がとれないほどの人気を博す。",
			"url": "https://lovemedo.net/sp_members.html#intro9"
		}
	}, {
		"@type": "Question",
		"name": "恋愛占いでは何が分かる？",
		"acceptedAnswer": {
			"@type": "Answer",
			"text": "一言で恋愛占いといっても、その内容は様々です。例えば、片想い中の相手の本音を占うものや、相手との相性の度合いを占う相性占い、元恋人の現状を占う復縁占いなど、お悩みの内容によって異なります。そのため、もし恋愛関係の悩みを占う場合は、自分の悩みにあった占いを得意とする占い師を頼ってみると、より深いアドバイスを受けることができます。",
			"url": "https://lovemedo.net/sp_members.html#faq_1"
		}
	}, {
		"@type": "Question",
		"name": "恋愛占いにおける恋愛運とは？",
		"acceptedAnswer": {
			"@type": "Answer",
			"text": "恋愛運とは、恋愛に関する運勢や吉凶を表す要素のことを言います。占い師や占術によって解釈や評価方法は異なりますが、一般的には新しい出会いや異性の引き寄せ力、その人自身の魅力、周囲へ与える影響力などが関連しています。恋愛運がよいとされる時には、新しい恋愛が始まる機会が増えたり、片想い相手との相性が高まりやすい傾向があるとされています。",
			"url": "https://lovemedo.net/sp_members.html#faq_2"
		}
	}, {
		"@type": "Question",
		"name": "当たる恋愛占いの見分け方は？",
		"acceptedAnswer": {
			"@type": "Answer",
			"text": "恋愛占いは様々な種類が存在しますので、信頼性や当たり度合いにも差があります。もし確実に当たる恋愛占いを探したいなら、占い師の信頼性や実績をしっかりと確認しましょう。また、複数の占術の組み合わせで鑑定するものであれば、より悩みに対して多面的なアプローチが可能です。例えば四柱推命やタロットなど、異なる手法を組み合わせている場合、より精度の高い結果が期待できます。",
			"url": "https://lovemedo.net/sp_members.html#faq_3"
		}
	}, {
		"@type": "Question",
		"name": "恋愛占いと相性占いの違いは？",
		"acceptedAnswer": {
			"@type": "Answer",
			"text": "恋愛占いと相性占いの違いは、鑑定対象や焦点の当て方が異なります。恋愛占いとは主に個人の恋愛関係や恋愛運のことで、例えば例えば、「私の恋愛運はどうですか？」や「特定の人との恋愛に成功する可能性はありますか？」といった質問に答えるのに使われます。相性占いは、一般的に二人の人物や二つの要素の相性に焦点を当てた占いの形です。例えば、「私と彼／彼女の相性は良いですか？」といった質問に答えるのに使われます。",
			"url": "https://lovemedo.net/sp_members.html#faq_4"
		}
	}, {
		"@type": "Question",
		"name": "恋愛占いに強い占い師を見つけるためのポイントは？",
		"acceptedAnswer": {
			"@type": "Answer",
			"text": "恋愛占いに強い占い師を見つけるためには、まず占い師の専門性やこれまでの実績をレビューサイトや口コミなどで確認しましょう。実際に結ばれたカップルや夫婦の声があるかチェックしましょう。また、占い師の鑑定スタイルや接し方が自分に合っているかどうかも重要なポイントです。対面鑑定なら直接会った際の第一印象を、占いサイトであればサイトの雰囲気が自分に合っているか、直感も大切にしましょう。",
			"url": "https://lovemedo.net/sp_members.html#faq_5"
		}
	}, {
		"@type": "Question",
		"name": "恋愛占いの結果をどう活用すればいい？",
		"acceptedAnswer": {
			"@type": "Answer",
			"text": "恋愛占いの結果は、アドバイスをそのまま実行するのもよいですが、鑑定を受けた際に自分が感じた直感や現実的な状況と照らし合わせながら活用するのがよいでしょう。例えば、気になる相手と距離を縮めるためにコミュニケーションを工夫するなど、自分の恋愛に対する考え方や行動にも反映させると、より恋愛成就に繋がりやすくなります。",
			"url": "https://lovemedo.net/sp_members.html#faq_6"
		}
	}, {
		"@type": "Question",
		"name": "2025年の恋愛運はどんな時期？",
		"acceptedAnswer": {
			"@type": "Answer",
			"text": "2025年は恋愛運において大きな変化や新たな展開が訪れやすい時期とされています。この年は、人との縁が特に強まる年運が流れているため、偶然の出会いや、意外な人物との縁が恋愛へと繋がる可能性が高まります。2025年には自分自身の理想や価値観も変わりやすく、恋愛においても一歩踏み出す勇気が重要です。今までのパターンを見直し、新しいタイプの相手や異なる価値観の人とも積極的に関わることで、恋愛運が大きく向上する年になるでしょう。また、この年はコミュニケーション力が鍵となるため、相手への思いやりや感謝の気持ちを大切にし、素直に表現することが大切です。特に愛情面での絆が深まる運気が巡りやすく、関係が安定しやすくなります。新しい恋を求めている人にとっても、2025年は心を開いて出会いを受け入れることで、多くのチャンスが訪れるでしょう。",
			"url": "https://lovemedo.net/sp_members.html#faq_7"
		}
	}]
}

$(function () {
	function dayTab() {
		// 切り替えタブ非表示
		$('.day_tab_head').css('display', 'none');

		$('.day_content').css('display', '');
		$('.day_tab_content_inner:nth-of-type(2)').css('display', '');
		$('.day_tab_content_inner:nth-of-type(3)').css('display', 'none');
		$('.day_tab_content_inner:nth-of-type(4)').css('display', 'none');
		//$('.day_tab_content_inner:nth-of-type(5)').css('display', 'none');
		$('.day_tab_content_inner:last-child').css('display', 'none');
		$('.day_tab_head_list:first').css('display', 'none');
		// 吹き出し非表示
		// $('.day_balloon').css('display', 'none');
		// ロード時は「総合運（最初のタブ）」のインジケータと原稿を表示
		$('.day_tab_head_list_link:nth-of-type(2)').addClass('JS dayTabSelectLink');
		$('.day_tab_head_list:nth-of-type(2)').addClass('JS dayTabSelectList');
		$('.day_tab_content_inner:nth-of-type(2)').css('display', 'block');
		// タブ切り替えの挙動
		$('.day_tab_head_list').click(function () {
			var current = $('.day_tab_head_list').index(this);
			$('.day_tab_head_list').removeClass('JS dayTabSelectList');
			$('.day_tab_head_list').eq(current).addClass('JS dayTabSelectList');
			$('.day_tab_head_list_link').removeClass('JS dayTabSelectLink');
			$('.day_tab_head_list_link').eq(current).addClass('JS dayTabSelectLink');
			$('.day_tab_content_inner').css('display', 'none');
			$('.day_tab_content_inner').eq(current).css('display', 'block');
			$('.day_tab_content_inner:nth-of-type(1)').css('display', '');
			return false;
		});
	}
	setTimeout(function () {
		if (document.getElementById("today_showcase").style.display == "none") {
			setTimeout(arguments.callee, 10);
			return;
		}
		dayTab();
	}, 10);
});

